<h6 class="font_6" style="font-size:14px; line-height:1.2em; text-align:center;"><span style="font-size:14px;"><span style="color:#FFFFFF;"><span style="letter-spacing:0.163636em;"><span style="font-weight:normal;"><span class="wixGuard">​</span></span></span></span></span></h6>

<h6 class="font_6" style="font-size:20px; line-height:1.2em; text-align:center;"><span style="font-size:20px;"><span style="color:#FF9012;"><span style="letter-spacing:0.163636em;">ESTAREMOS ENCANTADOS DE ATENDERTE</span></span></span></h6></div></div></div></div></div></section><div id="comp-ifm7h3js" class="Vd6aQZ ignore-focus comp-ifm7h3js" tabindex="-1" role="region" aria-label="PAVIFLEX"><span class="mHZSwn">PAVIFLEX</span></div><section id="comp-innodozo" class="comp-innodozo Lw0u6i"><div id="bgLayers_comp-innodozo" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_comp-innodozo" class="VgO9Yg"></div></div><div data-testid="columns" class="So7Ias"><div id="mediaisa12oeg13" class="mediaisa12oeg13 YzqVVZ"><div id="bgLayers_mediaisa12oeg13" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_mediaisa12oeg13" class="VgO9Yg"></div></div><div data-mesh-id="mediaisa12oeg13inlineContent" data-testid="inline-content" class><div data-mesh-id="mediaisa12oeg13inlineContent-gridContainer" data-testid="mesh-container-content"><div id="comp-innodp11" class="comp-innodp11 aVng1S wixui-horizontal-line"></div><div id="comp-innodp0z" class="BaOVQ8 tz5f0K comp-innodp0z wixui-text" data-testid="richTextElement"><h2 class="font_2" style="line-height:0.9em; font-size:80px;"><span class="color_11">ZONNAX </span></h2>

<h2 class="font_2" style="font-size:40px; line-height:0.9em;"><span style="font-size:40px;"><span style="color:#FF9012;">CIRCUITOS DE ENTRENAMIENTO FUNCIONAL</span></span></h2></div><div id="comp-innodp0u" class="BaOVQ8 tz5f0K comp-innodp0u wixui-text" data-testid="richTextElement"><p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">Elige uno de nuestros circuitos o crea tu propio circuito de entrenamiento funcional. No hay límites en la personalización y el diseño de suelos con marcas funcionales. </span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"> </p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">Las marcas de los circuitos de entrenamiento ZONNAX están hechas con inserciones de goma en colores contrastados, por lo que nunca se borarrarán.</span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="wixGuard">​</span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">En nuestro catálogo te ofrecemos las marcas más comunes con las que realizar infinidad de actividades donde se trabaja la velocidad, la reacción, la coordinación, la agilidad, el equilibrio, el ritmo y la potencia.</span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"> </p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span style="color:#FF9012;">Adquiere un ZONNAX Circuito de Entrenamiento Funcional y te envíamos gratis tres programas completos de entrenamiento (HIIT, STRENGTH y CARDIO) desarrollados por We FitAcademy. </span></p></div><div class="comp-jsxe5mbc R6ex7N" id="comp-jsxe5mbc" aria-disabled="false"><a data-testid="linkElement" href="https://www.paviflexgymflooring.com/zonnax-compass" target="_self" class="kuTaGy zKbzSQ" aria-disabled="false"><span class="M3I7Z2">DESCUBRIR MÁS ></span></a></div><div id="comp-jsxddakb" class="TWFxr5"><div class="comp-jsxddakb"><style>
