<h2 class="font_2" style="font-size:60px; line-height:0.9em;"><span style="color:#FF9012;"><span style="font-size:50px;">PLATAFORMA DESLIZANTE</span></span></h2></div><div id="comp-j5atpcfp" class="BaOVQ8 tz5f0K comp-j5atpcfp wixui-text" data-testid="richTextElement"><h4 class="font_4" style="font-size:16px;"><span style="font-weight:normal;"><span class="color_11"><span style="font-size:16px;">Nueva modalidad de entrenamiento personal, efectiva y diferente que permite entrenar combinando ejercicios para favorecer la función cardíaca y tonificar los músculos del abdomen, brazos, glúteos y piernas.</span></span></span></h4>

<h4 class="font_4" style="font-size:16px;"><span style="font-weight:normal;"><span class="color_11"><span style="font-size:16px;"><span class="wixGuard">​</span></span></span></span></h4>

<h4 class="font_4" style="font-size:16px;"><span style="font-weight:normal;"><span class="color_11"><span style="font-size:16px;">SlideFLEX es una disciplina que reduce el riesgo de lesión gracias a su entrenamiento por fricción. </span></span></span></h4>

<h4 class="font_4" style="font-size:16px;"> </h4>

<h4 class="font_4" style="font-size:16px;"><span style="font-weight:normal;"><span class="color_11"><span style="font-size:16px;">SlideFLEX es una plataforma deslizante de gran formato personalizable con el logo del centro o del estudio e incluye programas de entrenamiento específicos desarrollados por We FitAcademy.</span></span></span></h4></div><div class="comp-j5atugmd R6ex7N" id="comp-j5atugmd" aria-disabled="false"><a data-testid="linkElement" href="mailto:info@paviflex.es?subject=Solicitud presupuesto SlideFLEX" target="_self" class="kuTaGy zKbzSQ" aria-disabled="false"><span class="M3I7Z2">SOLICITA PRESUPUESTO ></span></a></div><div class="comp-jvpaut1i R6ex7N" id="comp-jvpaut1i" aria-disabled="false"><a data-testid="linkElement" href="https://www.paviflexgymflooring.com/slideflex" target="_self" class="kuTaGy zKbzSQ" aria-disabled="false"><span class="M3I7Z2">PROGRAMAS DE ENTRENAMIENTO ></span></a></div><div id="comp-ig9f9pno" class="comp-ig9f9pno aVng1S wixui-horizontal-line"></div><div id="comp-ifm7h3je" class="BaOVQ8 tz5f0K comp-ifm7h3je wixui-text" data-testid="richTextElement"><h2 class="font_2" style="line-height:0.9em; font-size:80px;"><span class="color_11">TURFLEX</span></h2>

<h2 class="font_2" style="line-height:0.9em; font-size:80px;"><span style="color:#FF9012;"><span style="font-size:40px;">CÉSPED ARTIFICIAL</span></span></h2>

<h2 class="font_2" style="font-size:30px; line-height:0.9em;"><span style="font-size:30px;"><span class="color_11">ENTRENAMIENTO FUNCIONAL Y CARGA. INDOOR & OUTDOOR.</span></span></h2></div><div id="comp-ifm7h3jo" class="BaOVQ8 tz5f0K comp-ifm7h3jo wixui-text" data-testid="richTextElement"><p class="font_7" style="line-height:1.6em; font-size:16px;"><span style="font-size:16px;"><span class="color_11">Diseñado para el entrenamiento funcional intensivo y carga, </span></span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"> </p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">TurFLEX es personalizable 100%, tiene aspecto de césped natural y su instalación es muy sencilla. </span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"> </p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">Es una alternativa original para llevar el suelo de tu gimnasio a otro nivel. TurFLEX es un césped artificial de última generación fabricado con monofilamento de polietileno de máxima recuperación y fibra estabilizada UV </span><span style="color:#FF9012;">con mas de 80.000 puntadas por metro cuadrado. </span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"> </p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">Disponible en colores Verde, Azúl, Rojo, Negro y Rosa, puede personalizarse con marcas, logotipos y cualquier diseño, combinando todos los colores disponibles y por supuesto el Blanco.</span></p></div><div class="comp-inj62ewy R6ex7N" id="comp-inj62ewy" aria-disabled="false"><a data-testid="linkElement" href="https://www.paviflexgymflooring.com/cespedartificial" target="_self" class="kuTaGy zKbzSQ" aria-disabled="false"><span class="M3I7Z2">DESCUBRIR MÁS ></span></a></div><div id="comp-ig9fahc7" class="comp-ig9fahc7 aVng1S wixui-horizontal-line"></div><div id="comp-ifm7h3k22" class="BaOVQ8 tz5f0K comp-ifm7h3k22 wixui-text" data-testid="richTextElement"><h2 class="font_2" style="line-height:0.9em; font-size:80px;"><span class="color_11">LEDFLEX</span></h2>

<h2 class="font_2" style="font-size:50px; line-height:0.9em;"><span style="color:#FF9012;"><span style="font-size:50px;">INTERACTIVIDAD PORTÁTIL</span></span></h2></div><div id="comp-ifpoaubc" class="BaOVQ8 tz5f0K comp-ifpoaubc wixui-text" data-testid="richTextElement"><p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">LedFLEX es un sistema interactivo de luces con sensores de proximidad que se integran en el suelo y en la pared ofrecido como herramienta para la realización de ejercicios fitness.</span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"> </p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">Realmente fácil de instalar, LedFLEX se ofrece en versión WIFI (sin cables) y en versión WIRED (cableado) y es totalmente personalizable a gusto del cliente. </span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="wixGuard">​</span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span class="color_11">LedFLEX se ofrece normalmente integrado en las áreas de entrenamiento funcional ZONNAX y forman parte de los circuitos como estaciones interactivas.</span></p></div><div class="comp-inm8ufl1 R6ex7N" id="comp-inm8ufl1" aria-disabled="false"><a data-testid="linkElement" href="https://www.paviflexgymflooring.com/ledflex" target="_self" class="kuTaGy zKbzSQ" aria-disabled="false"><span class="M3I7Z2">DESCUBRIR MÁS ></span></a></div><div id="comp-igc7wnnv" class="comp-igc7wnnv aVng1S wixui-horizontal-line"></div><div id="comp-igc7wno7" class="BaOVQ8 tz5f0K comp-igc7wno7 wixui-text" data-testid="richTextElement"><h2 class="font_2" style="line-height:0.9em; font-size:80px;"><span style="color:#FFFFFF;">COLCHONETAS</span><span class="color_16"><span> </span></span></h2>

<h2 class="font_2" style="font-size:60px; line-height:0.9em;"><span style="color:#FF9012;"><span style="font-size:50px;">EJERCICIOS INDIVIDUALES </span></span></h2></div><div id="comp-igc7wno71" class="BaOVQ8 tz5f0K comp-igc7wno71 wixui-text" data-testid="richTextElement"><p class="font_7" style="line-height:1.6em; font-size:16px;"><span style="color:#FFFFFF;">Las colchonetas PaviFLEX proporcionan la comodidad necesaria para la realización de ejercicios en el suelo. Muy resistentes y duraderas, tienen un fácil y práctico almacenamiento en su colgador. Están disponibles en distintas dimensiones, espesores y colores. </span></p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"> </p>

<p class="font_7" style="line-height:1.6em; font-size:16px;"><span style="color:#FFFFFF;">Son personalizables con el logo del centro.</span></p>

