yle="line-height:1em; font-size:80px;"><span style="font-size:80px;"><span style="font-family:raleway;"><span style="font-weight:bold;"><span style="font-style:normal;"><span style="font-variant:normal;"><span style="color:rgb(27, 27, 30);"><span class="color_11" style="color:#FFFFFF;">SOBRE NOSOTROS</span></span></span></span></span></span></span></h2></div><div id="comp-kvv840nm" class="BaOVQ8 tz5f0K comp-kvv840nm wixui-text" data-testid="richTextElement"><p class="font_8" style="font-size:16px;"><span style="font-size:14px;"><span style="font-family:raleway;"><span style="font-weight:normal;"><span style="font-style:normal;"><span style="font-variant:normal;"><span style="color:rgb(27, 27, 30);"><span class="color_11" style="color:#FFFFFF;"><span style="font-size:16px;">Especialistas en pavimento para gimnasio.</span></span></span></span></span></span></span></span></p>

<p class="font_8" style="font-size:16px;"><span style="font-size:14px;"><span style="font-family:raleway;"><span style="font-weight:normal;"><span style="font-style:normal;"><span style="font-variant:normal;"><span style="color:rgb(27, 27, 30);"><span class="color_11" style="color:#FFFFFF;"><span style="font-size:16px;"> </span></span></span></span></span></span></span></span></p>

<p class="font_8" style="font-size:16px;"><span style="font-size:14px;"><span style="font-family:raleway;"><span style="font-weight:normal;"><span style="font-style:normal;"><span style="font-variant:normal;"><span style="color:rgb(27, 27, 30);"><span class="color_11" style="color:#FFFFFF;"><span style="font-size:16px;">PaviFLEX Gym Flooring es el productor español por excelencia de suelos para gimnasios. Sus más de 35 años de experiencia en la fabricación de planchas de goma y EVA, le otorgan los conocimientos necesarios para ofrecer las mejores soluciones en pavimentos para cada actividad deportiva.</span></span></span></span></span></span></span></span></p>

<p class="font_8" style="font-size:16px;"><span style="font-size:14px;"><span style="font-family:raleway;"><span style="font-weight:normal;"><span style="font-style:normal;"><span style="font-variant:normal;"><span style="color:rgb(27, 27, 30);"><span class="color_11" style="color:#FFFFFF;"><span style="font-size:16px;"> </span></span></span></span></span></span></span></span></p>

<p class="font_8" style="font-size:16px;"><span style="font-size:14px;"><span style="font-family:raleway;"><span style="font-weight:normal;"><span style="font-style:normal;"><span style="font-variant:normal;"><span style="color:rgb(27, 27, 30);"><span class="color_11" style="color:#FFFFFF;"><span style="font-size:16px;">Suelos técnicos, tan confortables que podrías entrenar descalzo. Producido en España con un poderoso caucho de alta densidad antimarcas, tan elástico que retorna la energía del impacto y reduce el riesgo de lesiones al entrenar. Es resistente al uso intensivo y duradero como ninguno, absorbe los impactos actuando como excelente aislante acústico; con un coeficiente de fricción óptimo para la actividad deportiva, es impermeable, muy fácil de limpiar y mantener. Su instalación es tan sencilla como unir losetas en puzzle sin encolar y es personalizable en multitud de colores, acabados y marcaciones.</span></span></span></span></span></span></span></span></p></div><div id="comp-kvv8cmzl" class="OQ8Tzd comp-kvv8cmzl pvlz2w"><iframe class="nKphmK" title="Instagram Feeds" aria-label="Instagram Feeds" scrolling="no" allowfullscreen allowtransparency="true" allowvr="true" frameborder="0" allow="autoplay;camera;microphone;geolocation;vr"></iframe></div></div></div></div></div></section><section id="comp-igj7s6l8" class="comp-igj7s6l8 Lw0u6i"><div id="bgLayers_comp-igj7s6l8" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_comp-igj7s6l8" class="VgO9Yg"></div></div><div data-testid="columns" class="So7Ias"><div id="mediaisa12oeh25" class="mediaisa12oeh25 YzqVVZ"><div id="bgLayers_mediaisa12oeh25" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_mediaisa12oeh25" class="VgO9Yg"></div></div><div data-mesh-id="mediaisa12oeh25inlineContent" data-testid="inline-content" class><div data-mesh-id="mediaisa12oeh25inlineContent-gridContainer" da